import { StyleSheet } from 'react-native';

const styles = StyleSheet.create({
  container: {
    alignItems: 'center'
  },
  text: {
    fontFamily: 'Roboto_400Regular',
    fontSize: 16,
  },
  inputBox: {

    paddingVertical: 12,
    fontFamily: 'Roboto_400Regular',
    fontSize: 16,
    color: '#9E9E9E'
  },
  inputBoxFora: {
    alignItems: 'center',
    flexDirection: "row",
    backgroundColor: 'white',
    width: 335,
    height: 48,
    borderColor: '#DFDFDF',
    margin: 10,
    paddingHorizontal: 16,
    paddingVertical: 12,
    borderRadius: 4,
    borderWidth: 1,
    fontFamily: 'Roboto_400Regular',
    fontSize: 16,
    color: '#9E9E9E'
  }
});

export default styles;
